import React from 'react'
import SearchBox from './SearchBox'
import "./app.css";
const Header = () => {
    return (
        <div className="container-fluid">
            <div className="row align-items-center text-white py-3">
                <div className="col-8">
                    <h2 className>Nassy Movie App</h2>
                </div>
                <div className="col-4">
                    <SearchBox/>
                </div>
            </div>
        </div>
    )
}

export default Header;
